def MungeData(im):
    coeffs = pywt.dwt2(data=im, wavelet='haar')
    return coeffs[0].ravel()


# The competition datafiles are in the directory ../input
# Read competition data files:
directory = '../input/'
train = pd.read_csv(directory+'train.csv')
test = pd.read_csv(directory+'test.csv')
features = train.columns[1:]
trainlabels = train.label 
alldata = pd.concat([train[features],test[features]])


reduceddata = None
for i in range(alldata.shape[0]):
    if(i % 5000 == 0):
        print(i)
    im = alldata.iloc[i][features]
    im = im.reshape(28, 28)
    imwavelet = MungeData(im)
    if(reduceddata is None):
        reduceddata = np.zeros((alldata.shape[0], len(imwavelet)))
    reduceddata[i, :] = imwavelet
PCA_COMPONENTS = 50
pca = PCA(n_components=PCA_COMPONENTS)
pcadata = pca.fit_transform(reduceddata)
x = pd.DataFrame(pcadata)
x.columns = ['i'+str(i) for i in range(PCA_COMPONENTS)]
ss = StandardScaler()
x[x.columns] = ss.fit_transform(x[x.columns])
x0 = GPZero(x).reshape(1,-1)
x1 = GPOne(x).reshape(1,-1)
x2 = GPTwo(x).reshape(1,-1)
x3 = GPThree(x).reshape(1,-1)
x4 = GPFour(x).reshape(1,-1)
x5 = GPFive(x).reshape(1,-1)
x6 = GPSix(x).reshape(1,-1)
x7 = GPSeven(x).reshape(1,-1)
x8 = GPEight(x).reshape(1,-1)
x9 = GPNine(x).reshape(1,-1)
gp = np.concatenate([x0,x1,x2,x3,x4,x5,x6,x7,x8,x9]).T
gptrain = gp[:train.shape[0]].argmax(axis=1)
gptest = gp[train.shape[0]:].argmax(axis=1)
print('Train Accuracy:',accuracy_score(train.label,gptrain))
testsubmission = pd.DataFrame({'ImageId': range(1,
                                                gptest.shape[0]+1),
                               'Label': gptest})
testsubmission.to_csv('gpsubmission.csv', index=False)


